function handleMenuClick (page, options) {
  const { state, setState, data } = options; 
  const menu_value = data.text;
  if (menu_value === 'View as list') {
    return setState(s => ({...s, menu_value, grid_expanded: true, repeater_expanded: false}))
  }
  setState(s => ({...s, menu_value, grid_expanded: false, repeater_expanded: true}))
}

